import React, { useEffect, useState } from 'react';
import { View, Text, ScrollView, TextInput } from 'react-native';
import { FontAwesome } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import { HeaderRequisicao, DadosUsuario } from '../../AuthContext';

function TConfiguracao() {
    const navigation = useNavigation();

    const [nome, setNome] = useState("a");
    const [sobrenome, setSobrenome] = useState("a");
    const [celular, setCelular] = useState("a");
    const [email, setEmail] = useState("a");
    const [preco, setPreco] = useState("a");
    const [cidade, setCidade] = useState("a");
    const [descricao, setDescricao] = useState("a");

    async function mostrarUsuario() {
        const userData = await DadosUsuario();
        const headers = await HeaderRequisicao();
        const url = `https://localhost:44396/api/ConfigUsu?id=${userData.ID}`;

        fetch(url, {
            method: 'GET',
            headers
        })
            .then((response) => response.json())
            .then((usuario) => {
                console.log(usuario);
                setNome(usuario.nome);
                setSobrenome(usuario.sobrenome);
                setEmail(usuario.email);
                setCidade(usuario.cidade);
                setCelular(usuario.celular);
                setPreco(usuario.preco);
                setDescricao(usuario.descricao);
            })
            .catch((error) => {
                console.log(error);
                alert('Erro ao inserir informações');
            });
    }

    useEffect(() => {
        mostrarUsuario();
    }, []);

    function avancar() {
        navigation.navigate('tConfirmarSenha');
    }

    return (
        <ScrollView>
            <View style={styles.container}>
                <Text style={styles.title}>Olá, Usuário!</Text>
                <View style={styles.view}>
                    <View style={styles.editor}>
                        <FontAwesome
                            name="pencil-square-o"
                            size={24}
                            color="black"
                            onPress={avancar}
                        />
                    </View>
                    <Text style={styles.text}>Nome</Text>
                    <TextInput style={styles.input} value={nome} />

                    <Text style={styles.text}>Sobrenome</Text>
                    <TextInput style={styles.input} value={sobrenome} />

                    <Text style={styles.text}>Email</Text>
                    <TextInput style={styles.input} value={email} />

                    <Text style={styles.text}>Cidade</Text>
                    <TextInput style={styles.input} value={cidade} />

                    <Text style={styles.text}>Celular</Text>
                    <TextInput style={styles.input} value={celular} />

                    <Text style={styles.text}>Preço</Text>
                    <TextInput style={styles.input} value={preco} />

                    <Text style={styles.text}>Descrição</Text>
                    <TextInput
                        style={styles.inputDesc}
                        value={descricao}
                        multiline
                    />
                </View>
            </View>
        </ScrollView>
    );
}

export default TConfiguracao;
